import React from 'react';
import { useHistory } from 'react-router';

function UserDetails(props) {
  let userlist = localStorage.getItem('userdata')
  let userstatus = localStorage.getItem('status')
  let history = useHistory();
  return ( 
    <React.Fragment>
    <h1>User details</h1>
    <span>{userlist} is logged in</span>
    <a href="" onClick="">Edit user</a>
    <a href="" onClick="">Delete user</a>
    <div class="role"><b>Role : {userstatus}</b></div>
    <button onClick="">Add user</button>
    </React.Fragment>
    )
}

export default UserDetails
